import React from 'react';

const myChat = () => {
    return (
        <div className='MyChat'>
            <div className="block-name">
                <h1>Name</h1>
            </div>

            <div className="block-write">
                <textarea placeholder="Введите текст..."></textarea>
                <button>Отправить</button>
            </div>
        </div>
    );
};

export default myChat;
